import React from 'react';

import './signin.css';
const Signin = () => {
   
    return (
        <div className="signin_container">
            <form>
                <Input typeText={'text'} placeholderText={"please put image url here"} />
                <button  type="submit">Detect</button>
            </form>
        </div>
        
    );
}
export default Signin;
